/*Estilos */
@import url("https://fonts.googleapis.com/css?family=Merriweather:400,400i,700,700i&display=swap");
@import url("https://fonts.googleapis.com/css2?family=Roboto+Condensed&display=swap");

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font: 400 16px/1.6 "Merriweather", serif;
  background-color: #6FB98F;
  color: rgb(2, 15, 20);
  overflow-x: hidden;
  word-wrap: break-word;
}

h1,
h2,
h3,
h4 {
  font-weight: 700;
}

h1,
.h1 {
  font-size: 2rem;
}

h2,
.h2 {
  font-size: 1.5rem;
  line-height: 1.5em;
  margin-bottom: 1.5rem;
}

h3,
.h3 {
  font-size: 1.35rem;
  line-height: 1em;
  margin-bottom: 1rem;
}

h4,
.h4 {
  font-size: 1.15rem;
  line-height: 1em;
  margin-bottom: 1rem;
}

p {
  font-size: 1rem;
  margin-bottom: 1rem;
}

@media (min-width: 768px) {
  h1,
  .h1 {
    font-size: 2.5rem;
  }
  h2,
  .h2 {
    font-size: 2rem;
  }
  h3,
  .h3 {
    font-size: 1.5rem;
  }
  h4,
  .h4 {
    font-size: 1.25rem;
  }
  p {
    font-size: 1.1rem;
  }
}

a {
  color: #021c1e;
  text-decoration: none;
}

a:hover {
  color: #2c7873;
}

abbr {
  text-decoration: none;
}

iframe {
  border: 0;
}

figcaption {
  font-size: 1rem;
  font-variant: small-caps;
}

/*Clases aplicadas a los elementos multimedia del sitio */
.imgFluid {
  max-width: 100%;
  height: auto;
}

.imgFluid2 {
  width: 20%;
  height: auto;
  float: left;
}

.videoFluid {
  position: relative;
  display: block;
  width: 50%;
  overflow: hidden;
}

.videoFluidItem {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 100%;
  border: 0;
}

.videoFluid::before {
  display: block;
  content: "";
  padding-top: 56.25%;
}

/*Clases para alineamiento de textos*/
.textJustify {
  text-align: justify;
}

.textCenter {
  text-align: center;
}

/*Clase para esconder un elemento que serÃ¡ Ãºnicamente visible a los lectores de pantalla*/
.sr {
  position: absolute;
  height: 1px;
  width: 1px;
  overflow: hidden;
  clip: rect(1px, 1px, 1px, 1px);
}

/****************************
Contenedores del sitio
*****************************/
main {
  width: 100%;
  padding: 50px 0;
}

header {
  padding: 15px 0;
}

footer {
  padding: 30px 0;
}

/*Contenido del header*/
header {
  font-size: 1rem;
  text-align: center;
  display: flex;
  flex-direction: column;
}



.brand {
  display: flex;
  align-items: center;
  justify-content: center;
}

.brand h1 span:last-child {
  font-style: italic;
  font-weight: 400;
}

.brand img {
  margin-right: 15px;
}

.brand a {
  color: rgb(2, 15, 20);
}

.brand,
.navbar
 {
  margin-bottom: 15px;
}

@media (min-width: 992px) {
  header {
    display: flex;
    flex-direction: row;
 
    align-items: flex-end;
  }
  
  .brand,
  .navbar
  {
    margin-bottom: 0;
    padding-left: 40px;
  }


}

/*Contenido del footer*/

footer {
  font-family: "Roboto Condensed", sans-serif;
  font-size: 0.9rem;
  position: relative;
  text-align: center;
  background-color: rgb(67, 58, 68);
  color: rgb(255, 255, 255);
}

footer p {
  font-size: 0.75rem;
  margin-bottom: 0;
}

.footer ul {
  list-style-type: none;
  padding: 30px 0;
  margin: 0;
}

.goTop {
  position: absolute;
  right: 15px;
  bottom: 0px;
  font-size: 2rem;
}

footer a {
  color: rgb(255, 255, 255);
}

footer a:hover {
  color: #2c7873;
}

@media (min-width: 768px) {
  footer {
    text-align: left;
  }
  .footer {
    display: flex;
    justify-content: space-between;
  }
  .footer ul li {
    display: inline-block;
  }
  .footer ul li::after {
    content: "â€¢";
    padding-right: 8px;
    padding-left: 8px;
  }
  .footer ul li:last-child::after {
    content: "";
    padding-right: 0;
    padding-left: 0;
  }
}

/*Las reglas que van a continuaciÃ³n consiguen que los contenidos dentro de .contaninerfluid o .container se adapten a los diversos dispositivos.*/
.containerFluid {
  width: 100%;
  padding-right: 15px;
  padding-left: 15px;
}

.container {
  margin-right: auto;
  margin-left: auto;
  padding-right: 15px;
  padding-left: 15px;
  width: 100%;
}

@media (min-width: 576px) {
  .container {
    max-width: 540px;
  }
}

@media (min-width: 768px) {
  .container {
    max-width: 720px;
  }
  .flexContainer {
    display: flex;
  }
  .spaceBetween {
    justify-content: space-between;
  }
}

@media (min-width: 992px) {
  .container {
    max-width: 960px;
  }
}

@media (min-width: 1200px) {
  .container {
    max-width: 1140px;
  }
}

/****************************
MenÃºs de navegaciÃ³n del sitio
*****************************/

/*MenÃº principal*/
nav.navbar {
  font-family: "Roboto Condensed", sans-serif;
  text-transform: uppercase;
  font-size: x-large;

}

nav.navbar ul {
  list-style-type: none;
}

nav.navbar a {
  font-weight: 700;
  color: rgba(2, 15, 20, 1);
}

nav.navbar a:hover {
  color: rgba(2, 15, 20, 0.5);
}

nav.navbar a.active {
  color: #2c7873;
  font-weight: 700;
}

@media (min-width: 992px) {
  nav.navbar ul {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  nav.navbar ul li {
    padding-left: 5px;
    padding-right: 40px;
  }
}



/****************************
PÃ¡gina de inicio
*****************************/

.home section + section {
  padding-top: 50px;
  padding-bottom: 50px;
}


ul.clubs {
  list-style-type: none;
}

ul.clubs li {
 padding: 15px;
}

ul.clubs li img {
  display: block;
  margin-left: auto;
  margin-right: auto;
}

ul.clubs li p:first-of-type {
  margin-top: 15px;
}

ul.clubs li p:first-of-type::before {
  content: " ";
  display: inline-block;
  width: 5%;
  height: 4px;
  background-color: rgb(2, 15, 20);
  margin-right: 15px;
  margin-bottom: 5px;
}

@media (min-width: 768px) {
  ul.clubs.gridContainer {
    display: grid;
    grid-template-columns: repeat(auto-fit, 50%);
  }
}

@media (min-width: 1200px) {
  ul.clubs.gridContainer {
    display: grid;
    grid-template-columns: repeat(auto-fit, 33.33333%);
  }
}

.content ul {
  list-style-type: none;
  padding-bottom: 30px;
}

.content ul li {
  background-color: rgb(255, 255, 255);
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  margin-bottom: 15px;
}

.content ul li p {
  margin: 10px;
}

.content ul li img:hover {
  opacity: 0.5;
}



@media (min-width: 768px) {
  .content ul {
    display: flex;
    justify-content: space-between;
  }
  .content ul li {
    width: 30%;
  }
  .intro p {
    width: 80%;
    margin-left: auto;
    margin-right: auto;
    line-height: 1.9em;
  }
 
}

@media (min-width: 1200px) {
  .gridContainer2cols {
    display: grid;
    grid-template-columns: 5% auto;
    column-gap: 15px;
  }

  article {
    text-align: justify;
    hyphens: auto;
  }
}
